INSERT INTO `labs_preventive_care` (`id`, `label`, `unit`, `range_start`, `range_end`, `notes`, `coding`, `code`) VALUES
(1, 'A/G Ratio', '', '0', '2', '(Albumin/Globulin Ratio)', 'LOINC', ''),
(2, 'ALBUMIN', 'g/dl', '3', '5', 'ALBUMIN - major constituent of serum protein (usually over 50%). High levels are seen in liver disease(rarely) , shock, dehydration, or multiple myeloma. Lower levels are seen in poor diets, diarrhea, fever, infection, liver disease, inadequate iron intake, third-degree burns and edemas or hypocalcemia.', '', ''),
(3, 'Alkaline Phosphatase', 'U/L', '20', '125', 'ALKALINE PHOSPHATASE - Used extensively as a tumor marker it is also present in bone injury, pregnancy, or skeletal growth (elevated readings.  Low levels are sometimes found in hypoadrenia, protein deficiency, malnutrition and a number of vitamin deficiencies.', 'LOINC', '15148-0'),
(4, 'ALP', 'U/L', '20', '125', 'ALKALINE PHOSPHATASE - Used extensively as a tumor marker it is also present in bone injury, pregnancy, or skeletal growth (elevated readings.  Low levels are sometimes found in hypoadrenia, protein deficiency, malnutrition and a number of vitamin deficiencies', 'LOINC', '15148-0'),
(5, 'ALT', 'U/L', '0', '48', NULL, NULL, NULL),
(6, 'ANION GAP', '', '4', '14', 'ANION GAP (Sodium + Potassium - CO2 + Chloride) - An increased measurement is associated with metabolic acidosis due to the overproduction of acids (a state of alkalinity is in effect). Decreased levels may indicate metabolic alkalosis due to the overproduction of alkaloids (a state of acidosis is in effect).', 'LOINC', '41276-7'),
(8, 'BASOPHILS', '%', '0', '2', 'BASOPHILS and BASOPHIL COUNT - Basophilic activity is not fully understood but it is known to carry histamine, heparin and serotonin. High levels are found in allergic reactions.', 'LOINC', '26444-0'),
(9, 'BILIRUBIN', 'mg/dl', '0', '1', 'BILIRUBIN, TOTAL - Elevated in liver disease, mononucleosis, hemolytic anemia, low levels of exposure to the sun, and toxic effects to some drugs, decreased levels are seen in people with an inefficient liver, excessive fat digestion, and possibly a diet low in nitrogen bearing foods', 'LOINC', '1977-8'),
(10, 'BP Monitoring', '', '-999999', '999999', '', '', ''),
(11, 'BS-Fasting', '', '-999999', '999999', '', '', ''),
(12, 'BS-PBreakfast', '', '-999999', '999999', '', '', ''),
(13, 'BS-PLunch', '', '-999999', '999999', '', '', ''),
(14, 'BS-PostDinner', '', '-999999', '999999', '', '', ''),
(15, 'BUN', 'mg/dL', '6', '25', 'Urea Nitrogen patient serum/plasma, quantitative', 'LOINC', '14937-7'),
(16, 'BUN/CREATININE', '', '6', '25', 'This calculation is a good measurement of kidney and liver function.', '', ''),
(17, 'Calcium', 'meq/L', '8', '10', 'CALCIUM - involved in bone metabolism, protein absorption, fat transfer muscular contraction, transmission of nerve impulses, blood clotting and cardiac function. Regulated by parathyroid.', 'LOINC', '41645-3'),
(18, 'Calcium/Phosphorus Ratio', '', '2', '3', '', 'LOINC', ''),
(19, 'Capillary Glucose', '', '0', '0', NULL, NULL, NULL),
(20, 'Cardiac CATH', '', '-999999', '999999', '', '', ''),
(21, 'Chloride', 'mmol/L', '-999999', '999999', 'CHLORIDE - Elevated levels are related to acidosis as well as too much water crossing the cell membrane. Decreased levels with decreased serum albumin may indicate water deficiency crossing the cell membrane (edema).', 'LOINC', '2075-0'),
(22, 'Cholesterol/LDL Ratio', '', '1', '6', '', '', ''),
(23, 'CK-MB CK isoenzyme', 'IU/L', '-999999', '999999', 'It begins to increase 6 to 10 hours after an acute MI, peaks in 24 hours, and remains elevated for up to 72 hours.\n< 12 IU/L if total CK is <400 IU/L \n<3.5% of total CK if total CK is >400 IU/L .', '', ''),
(24, 'CO2', 'mEq/L', '22', '32', 'CO2 (Carbon Dioxide) - The CO2 level is related to the respiratory exchange of carbon dioxide in the lungs and is part of the bodies buffering system. Generally when used with the other electrolytes, it is a good indicator of acidosis and alkalinity.', 'LOINC', '2028-9'),
(25, 'Compliance', '', '0', '0', '', NULL, NULL),
(26, 'Creatine phosphokinase', 'U/L', '25', '200', '', 'LOINC', ''),
(27, 'Creatinine', 'mg/dl', '1', '1', 'CREATININE - Low levels are sometimes seen in kidney damage, protein starvation, liver disease or pregnancy. Elevated levels are sometimes seen in kidney disease due to the kidneys job of excreting creatinine, muscle degeneration, and some drugs involved in impairment of kidney function.', 'LOINC', '38483-4'),
(28, 'CRP', 'mg/L', '1', '10', 'C-Reactive Protein', 'LOINC', '45062-7'),
(29, 'Dental Exam', '', '0', '0', '', NULL, NULL),
(30, 'Dilated eye exam', '', '0', '0', '', NULL, NULL),
(31, 'DtaP/DTP/DT-1', '', '0', '0', '', NULL, NULL),
(32, 'DtaP/DTP/DT-2', '', '0', '0', '', NULL, NULL),
(33, 'DtaP/DTP/DT-3', '', '0', '0', '', NULL, NULL),
(34, 'DtaP/DTP/DT-4', '', '0', '0', '', NULL, NULL),
(35, 'DtaP/DTP/DT-5', '', '0', '0', '', NULL, NULL),
