(43, 'GGT', 'U/L', '0', '65', 'GGT (Gamma-Glutamyl Transpeptidase) - Elevated levels may be found in liver disease, alcoholism, bile-duct obstruction, cholangitis, drug abuse, and in some cases excessive magnesium ingestion. Decreased levels can be found in hypothyroidism, hypothalamic malfunction and low levels of magnesium.', 'LOINC', '27403-5'),
(44, 'GLOBULIN', 'g/dl', '2', '4', 'Globulins have many diverse functions such as, the carrier of some hormones, lipids, metals, and antibodies(IgA, IgG, IgM, and IgE). Elevated levels are seen with  chronic infections, liver disease, rheumatoid arthritis, myelomas, and lupus are present, . Lower levels in immune compromised patients, poor dietary habits, malabsorption and liver or kidney disease.', 'LOINC', ''),
