(73, 'Lactate dehydrogenase', 'U/L', '140', '280', 'Lactate dehydrogenase  - Total LDH will begin to rise 2 to 5 days after an MI; the elevation can last 10 days.', 'LOINC', '11053-6'),
(74, 'Last Dentist Apt.', '', '0', '0', NULL, NULL, NULL),
(75, 'Last Eye Apt.', '', '0', '0', NULL, NULL, NULL),
(76, 'LDH', 'U/L', '0', '250', 'LDH (Lactic Acid Dehydrogenase) - Increases are usually found in cellular death and/or leakage from the cell or in some cases it can be useful in confirming myocardial or pulmonary infarction (only in relation to other tests). Decreased levels of the enzyme may be seen in cases of malnutrition, hypoglycemia, adrenal exhaustion or low tissue or organ activity.', 'LOINC', '32324-6'),
(77, 'LDH-1', '%', '18', '33', 'LDH-1 and LDH-2  LDH isoenzymes - Compare LDH 1 and LDH 2 levels. Normally, the LDH-1 value will be less than the LDH-2. In the acute MI, however, the LDH 2 remains constant, while LDH 1 rises. When the LDH 1 is higher than LDH 2, the LDH is said to be flipped, which is highly suggestive of an MI. A flipped pattern appears 12-24 hours post MI and persists for 48 hours.', '', ''),
(78, 'LDH-2', '%', '28', '40', 'LDH-1 and LDH-2  LDH isoenzymes - Compare LDH 1 and LDH 2 levels. Normally, the LDH-1 value will be less than the LDH-2. In the acute MI, however, the LDH 2 remains constant, while LDH 1 rises. When the LDH 1 is higher than LDH 2, the LDH is said to be flipped, which is highly suggestive of an MI. A flipped pattern appears 12-24 hours post MI and persists for 48 hours.', '', ''),
(79, 'LDL-Cholesterol', 'mg/dl', '62', '130', 'LDL (Low Density Lipoprotein) - studies correlate the association between high levels of LDL and arterial artherosclerosis', 'LOINC', '13457-7'),
(80, 'LYMPHOCYTES', 'K/uL', '-999999', '999999', 'LYMPHOCYTES and LYMPHOCYTE COUNT - Elevated levels may indicate an active viral infections such as measles, rubella, chickenpox, or infectious mononucleosis.', 'LOINC', '26474-7'),
(81, 'MCH', 'pg', '80', '100', 'Mean corpuscular hemoglobin (MCH) is a calculation of the amount of oxygen-carrying hemoglobin inside your RBCs. Since macrocytic RBCs are larger than either normal or microcytic RBCs, they would also tend to have higher MCH values.', 'LOINC', '785-6'),
(82, 'MCHC', '%', '32', '36', 'Mean corpuscular hemoglobin concentration (MCHC) is a calculation of the concentration of hemoglobin inside the RBCs. Decreased MCHC values (hypochromia) are seen in conditions where the hemoglobin is abnormally diluted inside the red cells, such as in iron deficiency anemia and in thalassemia. Increased MCHC values (hyperchromia) are seen in conditions where the hemoglobin is abnormally concentrated inside the red cells, such as in hereditary spherocytosis, a relatively rare congenital disorder', 'LOINC', ''),
(83, 'MCV', 'fl', '80', '100', 'Mean corpuscular volume (MCV) is a measurement of the average size of your RBCs. The MCV is elevated when your RBCs are larger than normal (macrocytic), for example in anemia caused by vitamin B12 deficiency. When the MCV is decreased, your RBCs are smaller than normal (microcytic), such as is seen in iron deficiency anemia or thalassemias.', 'LOINC', '30428-7'),
(84, 'Medication Review', '', '0', '0', 'Every visit with comprehensive review annually.', NULL, NULL),
