(107, 'RBC', 'M/uL', '0', '0', 'Red Blood Cells (Erythrocytes), patient blood', 'LOINC', '790-6'),
(108, 'RDW', '%', '-999999', '999999', 'Red cell distribution width (RDW) is a calculation of the variation in the size of your RBCs. In some anemias, such as pernicious anemia, the amount of variation (anisocytosis) in RBC size (along with variation in shape ? poikilocytosis) causes an increase in the RDW.', 'LOINC', '21000-5'),
(109, 'SGOT', 'U/L', '10', '42', 'will begin to rise in 8-12 hours and peak in 18-30 hours', '', ''),
(110, 'Smoking cessation', '', '0', '0', '', NULL, NULL),
(111, 'Sodium', 'mmol/L', '135', '146', 'SODIUM -  Sodium is the most abundant cation in the blood and its chief base. It functions in the body to maintain osmotic pressure, acid-base balance and to transmit nerve impulses. Very Low value: seizure and Neurologic Sx.', 'LOINC', '2951-2'),
(112, 'Sodium/Potassium', '', '26', '38', '', '', ''),
(113, 'Stress Test', '', '-999999', '999999', '', '', ''),
(114, 'T3', '%', '27', '47', 'T3-UPTAKE - Increased levels are found in hyperthyroidism, severe liver disease, metastatic malignancy, and pulmonary insufficiency. Decreased levels are found in hypothyroidism, normal pregnancy, and hyperestrogenis status.', '', ''),
(115, 'T4', 'ug/dL', '4', '12', 'THYROXINE (T4) - Increased levels are found in hyperthyroidism, acute thyroiditis, and hepatitis. Low levels can be found in Cretinism, hypothyroidism, cirrhosis, malnutrition, and chronic thyroiditis.', 'LOINC', '27891-1'),
