(121, 'ThyAB', '', '0', '0', '', NULL, NULL),
(122, 'Total Cholesterol', 'mg/dl', '120', '140', 'CHOLESTEROL - High density lipoproteins (HDL) is desired as opposed to the low density lipoproteins (LDL), two types of cholesterol. Elevated cholesterol has been seen in artherosclerosis, diabetes, hypothyroidism and pregnancy. Low levels are seen in depression, malnutrition, liver insufficiency, malignancies, anemia and infection.\nNormal Adult Range: 120 - 240 mg/dl\nOptimal Adult Reading: 180', 'LOINC', '14647-2'),
(123, 'Total Protein', 'g/dl', '6', '8', 'PROTEIN, TOTAL - Decreased levels may be due to poor nutrition, liver disease, malabsorption, diarrhea, or severe burns. Increased levels are seen in lupus, liver disease, chronic infections, alcoholism, leukemia, tuberculosis amongst many others.', 'LOINC', '18281-6'),
(124, 'TRIGLYCERIDES', 'mg/dl', '0', '200', 'TRIGLYCERIDES - Increased levels may be present in artherosclerosis, hypothyroidism, liver disease, pancreatitis, myocardial infarction, metabolic disorders, toxemia, and nephrotic syndrome. Decreased levels may be present in chronic obstructive pulmonary disease, brain infarction, hyperthyroidism, malnutrition, and malabsorption.', 'LOINC', '14927-8'),
(125, 'TSH', 'miliU/L', '0', '0', 'THYROID-STIMULATING HORMONE (TSH) - produced by the anterior pituitary gland, causes the release and distribution of stored thyroid hormones. When T4 and T3 are too high, TSH secretion decreases, when T4 and T3 are low, TSH secretion increases.', 'LOINC', '20452-9'),
(126, 'URIC ACID', 'mg/dl', '2', '7', 'URIC ACID - High levels are noted in gout, infections, kidney disease, alcoholism, high protein diets, and with toxemia in pregnancy. Low levels may be indicative of kidney disease, malabsorption, poor diet, liver damage or an overly acid kidney.', 'LOINC', '14934-4'),
(127, 'Urinalysis', '', '0', '0', '', NULL, NULL),
