(131, 'WBC', 'K/uL', '-999999', '999999', 'White blood cell (WBC) count is a count of the actual number of white blood cells per volume of blood. Both increases and decreases can be significant.', 'LOINC', '6690-2'),
(132, 'WBCD', '', '-999999', '999999', 'White blood cell differential looks at the types of white blood cells present. There are five different types of white blood cells, each with its own function in protecting us from infection. The differential classifies a person''s white blood cells into each type: neutrophils (also known as segs, PMNs, grans), lymphocytes, monocytes, eosinophils, and basophils.', 'LOINC', '');
